import { Navbar,Nav,Container } from "react-bootstrap"
const HeaderNav = () => {
    return (
        <Navbar bg="success" variant="dark">
           
                <Nav  className='ml-auto' style={{marginLeft:'58rem'}} >
                    <Nav.Link href="#pricing"><i class="far fa-bell"></i></Nav.Link>
                    <Nav.Link href="#pricing">User Name</Nav.Link>
                </Nav>
            
        </Navbar>
    )
}
export default HeaderNav
